(function($) {
    "use strict"; // Start of use strict

    // jQuery for page scrolling feature - requires jQuery Easing plugin
    $('a.page-scroll').bind('click', function(event) {
        var $anchor = $(this);
        $('html, body').stop().animate({
            scrollTop: ($($anchor.attr('href')).offset().top - 50)
        }, 1250, 'easeInOutExpo');
        event.preventDefault();
    });

    // Highlight the top nav as scrolling occurs
    $('body').scrollspy({
        target: '.navbar-fixed-top',
        offset: 51
    })

    // Closes the Responsive Menu on Menu Item Click
    $('.navbar-collapse ul li a').click(function() {
        $('.navbar-toggle:visible').click();
    });

    // Fit Text Plugin for Main Header
    $("h1").fitText(
        1.2, {
            minFontSize: '35px',
            maxFontSize: '65px'
        }
    );

    // Offset for Main Navigation
    $('#mainNav').affix({
        offset: {
            top: 100
        }
    })

    // Initialize WOW.js Scrolling Animations
    new WOW().init();

})(jQuery); // End of use strict
;
$(document).ready(function(){       
   var scroll_start = 0;
   var startchange = $('#mainNav');
   var offset = startchange.offset();
   $(document).scroll(function() { 
      scroll_start = $(this).scrollTop();
      if(scroll_start > offset.top) {
          $('#mainNav').css('background-color', 'rgba(34,34,34,0.9)');
       } else {
          $('#mainNav').css('background-color', 'transparent');
       }
   });
});
var timer = 0; //setting this up as global

$(document).ready( function () {

       // $("#mySite").hide(); // you could have the site as display:none in css instead of this line.
        timer = setInterval( showSite , 8000 ) // here's your 2 seconds delay

});

function showSite() {
      clearInterval(timer);
      $(".sp-containers").fadeOut();
      $("#mySite").fadeIn();
}
